import React from "react";
import {Container} from "reactstrap";
import {Row, Col} from "reactstrap";
import image4 from '../ICON/Chan man Fung.png'


import './Main.css';


const Main = () => (
    <Container>
        <Row>
            <Col><img className="profile-pic" src={image4}/></Col>
        </Row>
        <Row>
            <Col><img className="profile-pic" src={image4}/></Col>
            <Col><img className="profile-pic" src={image4}/></Col>
            <Col>.col</Col>
            <Col>.col</Col>
        </Row>


    </Container>

);

export default Main;
